import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// import Image from 'react-bootstrap/Image';
import headshot from '../../images/jeff-berlin-landing-background-min.jpg';

function Landing() {
  return (
    <Container fluid className='landing' style={{ paddingTop: '64px', paddingBottom: '1rem', minHeight: '100vh', backgroundImage: `url(${headshot})`, backgroundSize: 'cover', backgroundPosition: 'top', backgroundRepeat: 'no-repeat'}}>
      <Row style={{ marginTop: '70vh'}}>
        <Col xl={6} style={{ paddingLeft: '0'}}>
          <div style={{ padding: '20px', backgroundColor: '#4f4f4f'}}>
            <h1 style={{ color: '#fff' }}>Jeff Berlin</h1>
            <h2>UI/UX Developer & Designer</h2>
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default Landing;
